import React from "react";
import ImageBox from "../ImageBox";
import Image1 from "./Image1";
import Text1 from "./Text1";
import TextBox from "../TextBox";

const ContentsBox = () => {
  return (
    <>
      <ImageBox>
        <Image1 />
      </ImageBox>
      <TextBox>
        <Text1 />
      </TextBox>
    </>
  );
};

export default ContentsBox;
